import React, { useEffect } from 'react';
import Header_Sub from '../components/Header_Sub';
import Logo from 'assets/img/Logo.png';
import 'assets/css/style.css';
import Footer from '../components/Footer';
import Container from '../components/Container';
import Button from '../components/Button';

const Connexion = () => {
    useEffect(() => {
        document.title = 'Se connecter';
    }, []);
    return (
        <body>
            <Header_Sub logo = {Logo} description = "Logo"/>
            <main className='formClass'>
                <h1>Se connecter</h1>
                <p>Bienvenue sur Farm Game : le jeu de simulation de culture sur terrain.<br>Sur ce site, vous êtes libre de personnaliser votre expérience à volonté en allant de créer vos cultures jusqu’à</br>interagir avec d’autres utilisateurs.</p>
                <Container>
                    <form method='post' className='login'>
                        <p>Mail : <input type='mail' name='mail'/></p>
                        <p>Mot de passe : <input type='password' name='motDePasse'/></p>
                        <p className='link'><a href='#'>Vous n’avez pas de compte ? Inscrivez-vous en appuyant ici</a></p>
                        <Button link = '#' text = 'Valider'></Button>
                    </form>
                </Container>
            </main>
            <Footer copyright = "© Tous droits réservés. Farm Game 2024"></Footer>
        </body>
    );
};

export default Connexion;
